import queryString from 'query-string';
import TableData from "./Table";
import ReactTable from 'react-table'

const Home = ({ location }) => {
    const [name, setName] = useState('');

    useEffect(() => {
        const { name } = queryString.parse(location.search);

        setName(name)

    }, [location.search]);



    return (
        <TableData />
    );
}

export default Home;
